import axios from 'axios';
import './App.css';

function App() {

    const [backendData, setBackendData] = useState();

    useEffect(() => {

      getBackendData();

    },[])

    function getBackendData() {
      try{
        const response = axios.get("http://localhost:5000/api")
        setBackendData(response.data);
      }
      catch(e) {
        console.log("error", e);
      }

    }

  return (
    <div className="App">
      <h1>Lokal App for Local People</h1>
      <h3>{backendData}</h3>
    </div>
  );
}

export default App;
